import React from 'react'

const cart = 
[ 
  {
    id: 1,
    className: 'cart',
    title: 'Adding products',
    input: <input 
      placeholder='+7 (__) ___ __ - __'
      type='tel'
    />,
    button: <button>Order</button>,
  }
]

const Cart = ({cartItems}) => {
  return (
    <>
    {cart.map(({id, className,title, input, span, button}) => (
      <form key={id} className={className}>
        <div>
          <h3>{title}</h3>
          {span}
        </div>
        <div className='submit'>
          {input}
          {button}
        </div>
      </form>
    ))}
    </>
  )
}

export default Cart
